export default function TodoApp () {
    return (
        <div className="TodoApp">
            Todo Management App
            <Login/>
        </div>
    );
}

function Login () {
    return (
        <div className="Login">
            <div className="LoginForm">
                <div>
                    <label>Username</label>
                    <input type="text" name="username"/>
                </div>
            </div>
        </div>
    );
}

function Welcome () {
    return (
        <div className="Welcome">
            Welcome Component
        </div>
    );
}
